import { Outlet } from "react-router-dom";
import { Link } from "react-router-dom";
import { useEffect, useState } from "react";

const PropertyDetail = (props) => {
    // console.log('props');
    // console.log(props);
    // console.log(localStorage.getItem('property_id'));

    const property_id = localStorage.getItem('property_id');

    const [property, setProperty] = useState({
        "address": "",
        "city": "",
        "country": "",
        "host email": "",
        "host name": "",
        "host phone": "",
        "host username": '',
        "lowest_avail_price": '',
        'num_of_beds': '',
        'num_of_guests': '',
        'property_id': '',
        'property_type': '',
        'property_name': ''
    });

    useEffect(() => {
        fetch(`http://localhost:8000/property/detail/${property_id}/`)
            .then((res) => res.json())
            .then(data => {
                console.log(data.results[0]['host name']);
                setProperty(
                    {
                        "address": data.results[0]['address'],
                        "city": data.results[0]['city'],
                        "country": data.results[0]['country'],
                        "host email": data.results[0]['host email'],
                        "host name": data.results[0]['host name'],
                        "host phone": data.results[0]['host phone'],
                        "host username": data.results[0]['host username'],
                        "lowest_avail_price": data.results[0]['lowest_avail_price'],
                        'num_of_beds': data.results[0]['num_of_beds'],
                        'num_of_guests': data.results[0]['num_of_guests'],
                        'property_id': data.results[0]['property_id'],
                        'property_type': data.results[0]['property_type'],
                        'property_name': data.results[0]['property_name']
                    }
                );
                console.log(property);
            });
    }, []);

    return (
        <div>
            <h1>Property Detail</h1>
            <div>
                <h2>{property?.name}</h2>
            </div>
        </div>
    );
}

export default PropertyDetail;
